--------------------------------------------------------
--  DDL for View VIEW_IOLIST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "VIEW_IOLIST" ("SEQ", "IODATE", "INOUT", "DCODE", "DNAME", "DCEO", "DTEL", "PCODE", "PNAME", "QTY", "IPRICE", "OPRICE", "PRICE", "AMT") AS 
  (
SELECT 
    IO_SEQ AS SEQ,
    IO_DATE AS IODATE, -- AS DATE 하면 date라는 키워드가 있어서 FROM keyword not found where expecte 오류 발생
    IO_INOUT AS INOUT,
    IO_DCODE AS DCODE,
    D_NAME AS DNAME,
    D_CEO AS DCEO,
    D_TEL AS DTEL,
    IO_PCODE AS PCODE,
    P_NAME AS PNAME,
    IO_QTY AS QTY,
    P_IPRICE AS IPRICE,
    P_OPRICE AS OPRICE,
    IO_PRICE AS PRICE,
    IO_AMT AS AMT
    
    
FROM tbl_iolist IO
    LEFT JOIN tbl_product P
        ON IO.io_pcode = P.p_code
    LEFT JOIN tbl_dept D
        ON IO.io_dcode = D.d_code
--ORDER BY IO.io_date, IO.io_pcode;
)
;
REM INSERTING into VIEW_IOLIST
SET DEFINE OFF;
